function calculateContractBillingOnDate(t,e){return"Transactional"===t.Type?t.Matters.reduce(function(t,n){return t+calculateMatterBillingOnDate(n,e)},0):0}function calculateMatterBillingOnDate(t,e){return t.DataSets.reduce(function(t,e){return t+e.DataSize},0)}var currencyFormatter=Intl.NumberFormat("en-US",{style:"currency",currency:"USD"});